import React from "react";
import {View, Image, StyleSheet, TouchableOpacity, Text} from "react-native";

const ContratameScreen = () => {
    return (
        <View>
            

            <Image source={require("../assets/dawrin.jpg")} 
                style={{width: 300, height: 300, borderRadius: 300/ 2, alignItems: "center", justifyContent: "center"}} 
            />
            <Text style={{textAlign: "center", marginTop: 10}}>
                Dawrin Peguero Alvarez 2021-1437
            </Text>
            <Text style={{textAlign: "center", marginTop: 10}}> dawrinpegueroalvarez@hotmail.com</Text>




        </View>
    );
}

export default ContratameScreen;
